/*Data for the table `book` */

insert  into `book`(`bookId`,`bookName`,`bookType`,`bookTheme`,`author`,`description`,`inboundTime`,`inboundCount`,`remainCount`,`borrowCount`) values ('1606301892673','三国演义','文学','英雄争霸','罗贯中','三国演义是我国古代第一部长篇章回小说','2020-11-25',6,5,1),('1606301975938','西游记','文学','西天取经','吴承恩','主要描述了孙悟空大闹天宫,唐曾出师和师徒四人西天取经','2020-11-25',4,4,0),('1606302026988','红楼梦','文学','爱情','曹雪芹','以贾宝玉，林黛玉，薛宝钗三个人之间的感情纠葛为主线','2020-11-25',9,9,0),('1606302106806','水浒传','文学','农民起义','施耐庵','《水浒传》是第一部描写农民起义的小说，全书围绕“官逼民反”这一线索展开情节，表现了一群不堪暴政欺压的“好汉”揭杆而起，聚义水泊梁山，直至接受招安致使起义失败的全过程。','2020-11-25',5,5,0),('1606302173013','C语言程序设计','计算机','程序','谭浩强','C语言程序设计主要是为初学者学习c语言编程打造的','2020-11-25',6,5,1),('1606302217489','java程序设计','计算机','程序','朱丽娟','java程序设计主要是为初学者学习java编程打造的','2020-11-25',3,3,0),('1606302250802','C++程序设计','计算机','程序','谭浩强','C++程序设计主要是为初学者学习C++编程打造的','2020-11-25',3,2,1),('1606302276654','C#编程基础','计算机','程序','谭浩强','C#程序设计主要是为初学者学习C#编程打造的','2020-11-25',5,5,0),('1606302339438','纯粹理性批判','哲学','现实世界','伊曼努尔·康德','这本书首先界定了人类知识的形式和范畴，然后论证了这些固有的形式和范畴只适用于现象世界','2020-11-25',3,2,1),('1606302388640','查拉图斯特拉如是说','哲学','人权','尼采','这部以散文和诗歌写成的杰作，宣扬“超人哲学”和“权力意志”，并带有异国情调和警告标志，以唤起耳聋和激励世界','2020-11-25',4,4,0),('1606305666711','法律帝国','法律','法律','德沃金','主要讲述了法律是怎么展开的，作者认为作为整体的法律理论是对法律的最佳阐述。','2020-11-25',4,3,1),('1606305785083','法理学的范围','法律','法律','奥斯丁','该书主要讲述了实际存在的由人制定的法与其他社会现象的关系，通过对二者的分析、比较划定法理学的研究范围。','2020-11-25',3,3,0),('1606305950611','宝葫芦的秘密','儿童文学','成长','张天翼','《宝葫芦的秘密》的主人公小学生王葆是一个天真活泼、富于幻想的少年。当他在学习上碰到困难时，或在课余生活中遇到不顺时，就幻想有一个神奇的宝贝来帮他轻松地解决问题。','2020-11-25',6,6,0),('1606306048410','寄小读者','文学','祖国和家乡','冰心','主要记述了海外的风光和奇闻异事，同时也抒发了她对祖国、对故乡的热爱和思念之情。','2020-11-25',3,2,1),('1606306215843','一只想飞的猫','文学','骄傲自大','陈佰吹','作品通过一系列生动有趣的情节，成功地塑造了一只\"想飞的猫\"的形象。这只猫骄傲自大、目空一切，只因抓住了几只老鼠就到处自吹自擂，说什么\"我一伸爪子就逮住了十三个耗子\"。','2020-11-25',3,2,1),('1606306458941','孙子兵法','战争','兵法战略','孙武','是一部内容完备、结构严谨的兵法谋略专著。在书中，孙武把与战争有关的军事问题，分为十三篇加以论述','2020-11-25',3,2,1),('1606351208857','德国国防军大本营','战争','战争书籍','威廉','讲述德国在第二世界大战中的故事。','2020-11-26',4,3,1),('1606358607133','老人与海','文学','大海','海明威','于1952年出版。该作围绕一位老年古巴渔夫，与一条巨大的马林鱼在离岸很远的湾流中搏斗而展开故事的','2020-11-26',4,4,0),('1606358689726','曾国藩家书','书信','书信集','曾国藩','记录了曾国藩在清道光30年至同治10年前后达30年的翰苑和从武生涯，近1500封。','2020-11-26',4,3,1),('1606358758681','儒林外史','文学','文学','吴敬梓','讲述范进中举等一些故事。','2020-11-26',4,2,2),('1606358837064','西厢记','经典剧目','经典剧目','王实甫','越剧四大经典剧目之一，是上海越剧院保留剧目之一，也是浙江小百花越剧团的经典剧目','2020-11-26',4,4,0),('1606358942740','红与黑','长篇小说','长篇小说','司汤达','作品讲述主人公于连是小业主的儿子，凭着聪明才智，在当地市长家当家庭教师时与市长夫人勾搭成奸，事情败露后逃离市长家，进了神学院。','2020-11-26',3,1,2),('1606359072518','呐喊','短篇小说','短篇小说','鲁迅','小说集真实地描绘了从辛亥革命到五四运动时期的社会生活，从革命民主主义出发，抱着启蒙主义目的和人道主义精神，揭示了种种深层次的社会矛盾','2020-11-26',3,3,0),('1606359135430','神曲','长诗','地狱','阿利盖利·但丁','这部作品作者通过与地狱、炼狱以及天堂中各种著名人物的对话','2020-11-26',3,1,2),('1606359190957','四世同堂','长篇小说','长篇小说','老舍','这是一部表现抗战北平沦陷区普通民众生活与抗战的长篇小说','2020-11-26',2,1,1),('1606359234027','活着','长篇小说','长篇小说','余华','讲述了在大时代背景下，随着内战、三反五反，大跃进，文化大革命等社会变革。','2020-11-26',3,3,0),('1606359303332','我的精神家园','长篇小说','生活','王小波','该书作者以一种近乎残酷的坦诚与直率，道出了我们身在其中却从未虑及的生活。','2020-11-26',3,3,0),('1606359382135','罪与罚','长篇小说','长篇小说','陀思妥耶夫斯基','小说描写穷大学生拉斯柯尔尼科夫受无政府主义思想毒害，认为自己可以为所欲为','2020-11-26',3,3,0),('1606359478987','存在与虚无','哲学','哲学','萨特','作者运用自己独立的思想观点和哲学词语述说对世界的理解：人即自为的存在，具有超越的特性，他永远处在变化中，而且是在时间的流逝中实现的。','2020-11-26',3,2,1),('1606359537924','理想国','哲学','哲学','柏拉图','是柏拉图的一篇重要对话录，对话录里柏拉图以苏格拉底之口通过与其他人对话的方式设计了一个真、善、美相统一的政体。','2020-11-26',5,4,1),('1606359574476','形而上学','哲学','哲学','亚里士多德','重点阐述了存在论目的论的宇宙体系等','2020-11-26',5,5,0),('1606359677122','西方哲学史','哲学','哲学','罗素说','罗素说:哲学是诉之于理性而不是权威。这是我对罗素最欣赏的一句话，有了它，才能让我彻底放下顾忌而去研究哲学。','2020-11-26',5,1,4),('1606375977482','诡秘之主1','西方玄幻','英雄争霸','乌贼','《诡秘之主》是阅文集团白金作家爱潜水的乌贼所著的西方玄幻类小说，掺杂了克苏鲁风格、类SCP元素、第一次工业革命时代风情和蒸汽朋克情怀。这是一个蒸汽与机械的世界，这是一段“愚者”的传说1','2020-11-26',9,9,0),('1606392836820','三国演义2','战争','英雄争霸','罗贯中','三国演义是我国古代第一部长篇章回小说','2020-11-26',33,33,0),('1606392987607','三国演义3','历史','英雄争霸','罗贯中','三国演义是我国古代第一部长篇章回小说3','2020-11-26',11,11,0),('1606393118719','三国演义4','哲学','成长','罗贯中','三国演义是我国古代第一部长篇章回小说4','2020-11-26',22,21,1);

