insert  into `gonggao`(`gId`,`title`,`body`,`author`,`writeTime`) values (1,'主页','','admin','2020-11-26 03:34:45'),(2,'疫情主页','<h3 class=\"ql-align-center\"><img src=\"data:image/jpeg;base64,\"></h3><h1 class=\"ql-align-center\"><strong>坚决打赢疫情防控阻击战</strong></h1><h1 class=\"ql-align-center\">永远把人民放在第一位</h1><p class=\"ql-align-center\"><br></p>','admin','2020-11-26 03:27:11'),(3,'馆内公告','<h1 class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></h1><p><br></p><p><br></p><p><br></p><p><br></p>','admin','2020-11-26 03:25:56'),(4,'日常公告','<h1 class=\"ql-align-center\">图书馆日常公告</h1><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><h2>1、根据学校《关于2020年国庆节、中秋节放假安排的通知》精神，图书馆<span style=\"color: rgb(230, 0, 0);\">10月1-4日闭馆4天，10月5日后正常开馆</span>，请读者根据自己的学习需要，调整好图书借阅时间。</h2><p>&nbsp;</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><h2><br></h2><h2>2、原计划9月25日晚上（17:00-22:30）逢星期五闭馆全面消毒时间<span style=\"color: rgb(230, 0, 0);\">改为30日晚闭馆消毒</span>，25日（星期五）晚正常开馆。</h2>','admin','2020-11-27 00:52:14'),(5,'备用','','admin','2020-11-25 07:58:47');

